import React from 'react'
import { 
    VscStarEmpty,
    VscStarFull
} from 'react-icons/vsc'


const StarRating = () => {
  return (
    <div className="star-rating">
        {[...Array(5)].map((star) => {        
        return (         
          <span className="star"><VscStarFull /></span>        
        );
      })}
    </div>
  )
}

export default StarRating
